INSERT INTO `news` VALUES ('1', '1', '2016-09-24 11:11:11', '100', '2016-09-24 11:11:11', null, '0', '留学生分享美国高中教育体验1', '<p class=\"MsoNormal\"><span style=\"mso-spacerun:\'yes\';font-family:\'Century Gothic\';mso-fareast-font-family:\'Times New Roman\';font-size:10.0000pt;\">Good writing is a key in many careers, including public relations, photography, videography and electronic media production, as well as careers in business, marketing, sales, law, </span><span style=\"mso-spacerun:\'yes\';font-family:\'Century Gothic\';mso-fareast-font-family:\'Times New Roman\';font-size:10.0000pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"mso-spacerun:\'yes\';font-family:\'Century Gothic\';mso-fareast-font-family:\'Times New Roman\';font-size:10.0000pt;\">law enforcement, retail/merchandising and many other fields. Do you hope to be an entrepreneur and own your own business one day? The business will be more successful if you can develop well-written proposals and client reports. This class will help improve your grammar, punctuation and spelling; it will also help you develop your writing, rewriting and editing skills for news, public relations, advertising and other writing projects and careers. You will also learn to find relevant, </span><b><span style=\"font-family: \'Century Gothic\'; font-size: 10pt;\">CREDIBLE SOURCES</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Century Gothic\';mso-fareast-font-family:\'Times New Roman\';font-size:10.0000pt;\">&nbsp;and integrate their information into your writing. The chief focus will be the </span><i><span style=\"font-family: \'Century Gothic\'; font-size: 10pt;\">process </span></i><span style=\"mso-spacerun:\'yes\';font-family:\'Century Gothic\';mso-fareast-font-family:\'Times New Roman\';font-size:10.0000pt;\">of writing – not just composing but also planning, revising, proofreading and editing. This course will also help develop your </span><b><span style=\"font-family: \'Century Gothic\'; font-size: 10pt;\">MEDIA LITERACY</span></b><span style=\"mso-spacerun:\'yes\';font-family:\'Century Gothic\';mso-fareast-font-family:\'Times New Roman\';font-size:10.0000pt;\">&nbsp;– that is, your ability to discern credible, reputable journalistic SOURCES – online and published sources, as well as individuals, companies and organizations – and differentiate them from those that are less credible. In addition, we will cover some fundamentals of journalistic </span><b><span style=\"font-family: \'Century Gothic\'; font-size: 10pt;\">LAW AND ETHICS.</span></b><b><span style=\"font-family: \'Century Gothic\'; font-size: 10pt;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span style=\"mso-spacerun:\'yes\';font-family:\'Century Gothic\';mso-fareast-font-family:\'Times New Roman\';font-size:10.0000pt;\">&nbsp;</span></p>', 'chenaknghua', '互联网', '52', '/assets/pages/img/index3/news.jpg', '0');
