INSERT INTO `users` VALUES ('2', 'chenkanghua', '378573681@qq.com', '1', '0', '+86', '15818853022', '0', '96e79218965eb72c92a549dd5a330112', 'qq1314', 'cn', '广东省', '广州', '1111112233', '2016-10-11 00:08:14', null, '0', '9', '2', '77', '20', '8', '9', '10', '77', '96806.62', '/upload/user_pic/2_IDkWq_69188.png', '-1', '', '', null, 'MySQL是一个关系型数据库管理系统，由瑞典MySQL AB 公司开发，目前属于 Oracle 旗下产品。MySQL 最流的关系型数据库管理系统，在 WEB 应用方面MySQL是最好的 RDBMS (Relational Database Management System，关系数据库管理系统) 应用软件之一。@@@ \" \' \nMySQL是一种关联数据库管理系统，关联数据库将数据保存在不同的表中，而不是将所有数据放在一个大仓库内，这样就增加了速度并提高了灵活性。\nMySQL所使用的 SQL 语言是用于访问数据库的最常用标准化语言。MySQL 软件采用了双授权政策，它分为社区版和商业版，由于其体积小、速度快、总体拥有成本低，尤其是开放源码这一特点，一般中小型网站的开发都选择 MySQL 作为网站数据库。\n由于其社区版的性能卓越，搭配 PHP 和 Apache 可组成良好的开发环境。[1] ', 'IT工程师', 'wechat', '0', null, null, null, null, null, null);
