  `bid_count` varchar(255) DEFAULT '1' COMMENT '最大中标人数',
  `evaluate_state` int(11) DEFAULT '0' COMMENT '评价状态',
  `urgent` int(11) DEFAULT '0' COMMENT '是否加急，0不加急，1加急，2特急',
  `open` int(11) DEFAULT '1' COMMENT '是否公开，0不公开，1公开',
  `amount` decimal(18,2) DEFAULT '0.00' COMMENT '金额',
  `expire_date` varchar(50) DEFAULT NULL COMMENT '到期时间',
  `enclosure1` varchar(255) DEFAULT NULL COMMENT '附件1路径',
  `enclosure1_name` varchar(255) DEFAULT '附件1' COMMENT '附件1显示名字',
  `enclosure2` varchar(255) DEFAULT NULL COMMENT '附件2路径',
  `enclosure2_name` varchar(255) DEFAULT '附件2' COMMENT '附件2显示名字',
  `enclosure3` varchar(255) DEFAULT NULL COMMENT '附件3路径',
  `enclosure3_name` varchar(255) DEFAULT '附件3' COMMENT '附件3显示名字',
  `enclosure4` varchar(255) DEFAULT NULL,
  `enclosure4_name` varchar(255) DEFAULT NULL,
  `enclosure5` varchar(255) DEFAULT NULL,
  `enclosure5_name` varchar(255) DEFAULT NULL,
  `ip` varchar(50) DEFAULT NULL COMMENT '发任务时的ip地址',
  `country` varchar(255) DEFAULT NULL COMMENT '查询ip地址所在的国家',
  `region` varchar(255) DEFAULT NULL COMMENT '查询ip地址所在的省份/州',
  `city` varchar(255) DEFAULT NULL COMMENT '查询ip地址所在的城市',
  `location_open` int(11) DEFAULT '0' COMMENT '是否分享位置，0表示不分享，1表示分享',
  `location_name` varchar(255) DEFAULT NULL COMMENT '位置名称',
  `location_country` varchar(255) DEFAULT '' COMMENT '位置国家',
  `location_province` varchar(255) DEFAULT '' COMMENT '位置省/州',
  `location_district` varchar(255) DEFAULT '' COMMENT '位置县/地区',
  `latitude` double DEFAULT '0' COMMENT '位置纬度',
  `longitude` double DEFAULT '0' COMMENT '位置经度',
  `remark` varchar(512) DEFAULT '' COMMENT '用户对任务备注',
  `remark_admin` text,
  `remark_admin_date` varchar(50) DEFAULT '',
  `block_state` varchar(10) DEFAULT '0' COMMENT '屏蔽状态，0表示不屏蔽，1表示屏蔽',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=236 DEFAULT CHARSET=utf8;

