-- ----------------------------
-- Procedure structure for `sp_add_invoice_no`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_add_invoice_no`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_add_invoice_no`()
BEGIN
	#Routine body goes here...
  declare i INT;
  set i=1;
  while i <=1000 do

		begin
			insert invoice_no(invoice_no,state,create_date,modify_date,type)values(CONCAT('0000',100000000+i),0,'2016-10-01 11:11:11','2016-10-01 11:11:11','');
			set i=i+1;
		end;
	 
	end while;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_control_account_forward_expire`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_control_account_forward_expire`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_control_account_forward_expire`()
BEGIN
	DECLARE forward_expire_count INT;   -- 预付款到期总数
	-- type = 18 是转帐
	select count(*) INTO forward_expire_count from account_detail where To_Days(NOW())-To_Days(create_date) >=7  and state = 0 and type = 18;
  IF forward_expire_count >0 THEN
		repeat
			CALL SP_proc_account_forward_expire();
      set forward_expire_count = forward_expire_count-1;
      until forward_expire_count = 0
    end repeat; 
  END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_control_arbitration_expire`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_control_arbitration_expire`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_control_arbitration_expire`()
BEGIN
	DECLARE arbitration_expire_count INT;   -- 符合条件仲裁总数
	-- type = 18 是转帐
	select count(*) INTO arbitration_expire_count from arbitration where To_Days(NOW())-To_Days(modify_date) >=7  and state = 0;
  IF arbitration_expire_count >0 THEN
		repeat
			CALL SP_proc_arbitration_expire();
      set arbitration_expire_count = arbitration_expire_count-1;
      until arbitration_expire_count = 0
    end repeat; 
  END IF;
END
;;
DELIMITER ;

