-- Procedure structure for `sp_control_demand`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_control_demand`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_control_demand`()
BEGIN
	DECLARE demand_expire_count INT;   -- 任务到期总数
	-- state  0、表示等待接单 ,1、表示等待接单,2、表示选取写手,3、表示选取写手,4、表示完成
	select count(*) INTO demand_expire_count from demand where expire_date <= NOW() and state = 2 ;
  IF demand_expire_count>0 THEN
		repeat
			CALL SP_proc_expire_demand();
      set demand_expire_count = demand_expire_count-1;
      until demand_expire_count=0
    end repeat; 
  END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `SP_proc_account_forward_expire`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_proc_account_forward_expire`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_proc_account_forward_expire`()
BEGIN
	DECLARE vn_id INT;   -- account_detail id
	DECLARE vn_user_id INT;   -- 用户id
	DECLARE vd_amount DECIMAL;   -- 金额
	-- 事务处理
	DECLARE t_error INTEGER DEFAULT 0;  
  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1; 
	SELECT id,user_id,amount INTO vn_id,vn_user_id,vd_amount FROM account_detail WHERE To_Days(NOW())-To_Days(create_date) >= 7  and state = 0 and type = 18 LIMIT 1;
	-- 修改状态
	
	IF vn_id IS NOT NULL THEN
		UPDATE account_detail SET state = 1, modify_date = NOW() WHERE id = vn_id;
		-- 手续费为0.03 ,0.01是防止异常
		UPDATE account SET forward_usd = forward_usd-vd_amount*(1-0.03), usd = usd+vd_amount*(1-0.03) WHERE user_id = vn_user_id AND forward_usd-vd_amount*(1-0.03) >= 0.01;
	END IF;

		
	IF t_error = 1 THEN  
		ROLLBACK;  
	ELSE  
		COMMIT;  
	END IF; 
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_proc_arbitration_expire`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_proc_arbitration_expire`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_proc_arbitration_expire`()
BEGIN
	DECLARE vn_id INT;   -- account_detail id
	DECLARE vn_user_id INT;   -- 发起仲裁用户id
	DECLARE vn_refute_user_id INT;   -- 被仲裁用户id
	DECLARE vn_demand_id INT;   -- 发起仲裁用户id
	-- 事务处理
	DECLARE t_error INTEGER DEFAULT 0;  
  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1; 
	select id,user_id,refute_user_id,demand_id INTO vn_id,vn_user_id,vn_refute_user_id,vn_demand_id from arbitration where To_Days(NOW())-To_Days(modify_date) >=7  and state = 0 LIMIT 1;
	
	IF vn_id IS NOT NULL THEN
		UPDATE arbitration SET state = 1, modify_date = NOW(),refute_reason='超时没确认，系统自动确认' WHERE id = vn_id;
		-- 写系统消息
	END IF;
		
	IF t_error = 1 THEN  
		ROLLBACK;  
	ELSE  
		COMMIT;  
	END IF; 
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sp_proc_expire_demand`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_proc_expire_demand`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_proc_expire_demand`()
BEGIN
	DECLARE vn_user_id INT;   -- 发布任务用户id
	DECLARE vn_demand_id INT;   -- 任务id
	DECLARE vn_arbitration_count INT;   -- 未完成任务仲裁总数
	DECLARE vn_receive_demand_length INT;   -- 选择做任务总人数
	DECLARE vd_amount DECIMAL; -- 任务金额

	DECLARE vd_da_count DECIMAL DEFAULT 0; -- 附加任务的总数
	DECLARE i INT ;
	DECLARE vd_da_amount DECIMAL; -- 附加任务的金额
	DECLARE vd_da_amount_tmp DECIMAL DEFAULT 0; -- 附加任务的金额
	DECLARE vd_da_agv_amount DECIMAL DEFAULT 0; -- 附加任务平均金额
	DECLARE vd_arb_sum_amount DECIMAL DEFAULT 0; -- 任务仲裁返还总金额

	DECLARE vn_rd_length INT DEFAULT 0;  -- 选中做任务人总数
  -- 接任务人1的信息
	DECLARE vn_rd_id1 DECIMAL;  -- ID
	DECLARE vd_rd_amount1 DECIMAL;  -- 报价
	DECLARE vn_rd_user_id1 INT;     -- 用户
	DECLARE vd_arb_id1 INT; -- 仲裁ID
	DECLARE vd_arb_state1 INT; -- 仲裁比例
	DECLARE vd_arb_percentage1 DOUBLE DEFAULT 1; -- 仲裁比例
	DECLARE vd_arb_refute_percentage1 DOUBLE DEFAULT 1; -- 仲裁比例
	DECLARE vd_arb_rule_percentage1 DOUBLE DEFAULT 1; -- 仲裁比例
	DECLARE vd_percentage1 DOUBLE DEFAULT 1; -- 最终仲裁比例
	DECLARE vd_pay_amount1 DECIMAL DEFAULT 0; -- 任务返还金额
	DECLARE vd_arb_amount1 DECIMAL DEFAULT 0; -- 仲裁返还金额

  -- 接任务人2的信息
	DECLARE vn_rd_id2 DECIMAL;  -- ID
	DECLARE vd_rd_amount2 DECIMAL;  -- 报价
	DECLARE vn_rd_user_id2 INT;     -- 用户
	DECLARE vd_arb_id2 INT; -- 仲裁ID
	DECLARE vd_arb_state2 INT; -- 仲裁比例
	DECLARE vd_arb_percentage2 DOUBLE DEFAULT 1; -- 仲裁比例
	DECLARE vd_arb_refute_percentage2 DOUBLE DEFAULT 1; -- 仲裁比例
	DECLARE vd_arb_rule_percentage2 DOUBLE DEFAULT 1; -- 仲裁比例
	DECLARE vd_percentage2 DOUBLE DEFAULT 1; -- 最终仲裁比例
	DECLARE vd_pay_amount2 DECIMAL DEFAULT 0; -- 任务返还金额
	DECLARE vd_arb_amount2 DECIMAL DEFAULT 0; -- 仲裁返还金额

  -- 接任务人3的信息
	DECLARE vn_rd_id3 DECIMAL;  -- ID
	DECLARE vd_rd_amount3 DECIMAL;  -- 报价
	DECLARE vn_rd_user_id3 INT;     -- 用户
	DECLARE vd_arb_id3 INT; -- 仲裁ID
	DECLARE vd_arb_state3 INT; -- 仲裁比例
	DECLARE vd_arb_percentage3 DOUBLE DEFAULT 1; -- 仲裁比例
	DECLARE vd_arb_refute_percentage3 DOUBLE DEFAULT 1; -- 仲裁比例
	DECLARE vd_arb_rule_percentage3 DOUBLE DEFAULT 1; -- 仲裁比例
	DECLARE vd_percentage3 DOUBLE DEFAULT 1; -- 最终仲裁比例
	DECLARE vd_pay_amount3 DECIMAL DEFAULT 0; -- 任务返还金额
	DECLARE vd_arb_amount3 DECIMAL DEFAULT 0; -- 仲裁返还金额

	DECLARE t_error INTEGER DEFAULT 0;  
	-- DECLARE done INT DEFAULT 0;
	-- DECLARE cur CURSOR for( SELECT * from demand_attach_view); 
  -- DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;

	SELECT demand_id,user_id,amount INTO vn_demand_id, vn_user_id,vd_amount FROM demand WHERE expire_date <= NOW() AND state = 2 LIMIT 1;
	-- 修改任务状态
	SELECT count(*) INTO vn_arbitration_count FROM arbitration WHERE demand_id = vn_demand_id AND (state = 0 OR state = 2 OR state = 3);
	IF vn_arbitration_count>0 THEN
		-- 有未成功的仲裁
		SELECT 1;
	ELSE
		-- 修改任务状态
		UPDATE demand SET state = 4, modify_date = NOW() WHERE id = vn_demand_id AND user_id = vn_user_id;
		-- 获取附加任务金额
		SELECT count(*) INTO vd_da_count FROM demand_attach WHERE demand_id = vn_demand_id;
		SET i = 0;
		repeat 
			SELECT  amount INTO vd_da_amount_tmp FROM demand_attach WHERE demand_id = vn_demand_id LIMIT i,1;
			IF vd_da_amount_tmp IS NOT NULL THEN
				SET vd_da_amount = vd_da_amount+vd_da_amount_tmp;
			END IF;
			SET i = i + 1;
			until vd_da_count-1 <= i 
		end repeat; 


		-- 获取总中标人数
		SELECT count(*) INTO vn_receive_demand_length FROM receive_demand WHERE demand_id = vn_demand_id and state = 1; 
		IF vn_receive_demand_length >0 THEN
			-- 任务金额分配
			SELECT id,amount,user_id INTO vn_rd_id1,vd_rd_amount1,vn_rd_user_id1 FROM receive_demand where demand_id = vn_demand_id AND state = 1 limit 0,1;
			IF vn_rd_id1 IS NOT NULL THEN
				SELECT id,state,percentage,refute_percentage,rule_percentage INTO vd_arb_id1,vd_arb_state1,vd_arb_percentage1,vd_arb_refute_percentage1,vd_arb_rule_percentage1 FROM arbitration WHERE receive_demand_id = vn_rd_id1 ;
			ELSE 
				SET vn_rd_length = vn_rd_length+1;
			END IF;

			SELECT id,amount,user_id INTO vn_rd_id2,vd_rd_amount2,vn_rd_user_id2 FROM receive_demand where demand_id = vn_demand_id AND state = 1 limit 1,1;
			IF vn_rd_id2 IS NOT NULL THEN
				SELECT  id,state,percentage,refute_percentage,rule_percentage INTO vd_arb_id2,vd_arb_state2,vd_arb_percentage2,vd_arb_refute_percentage2,vd_arb_rule_percentage2 FROM arbitration WHERE receive_demand_id = vn_rd_id2 ;
			ELSE 
				SET vn_rd_length = vn_rd_length+1;
			END IF;

			SELECT id,amount,user_id INTO vn_rd_id3,vd_rd_amount3,vn_rd_user_id3 FROM receive_demand where demand_id = vn_demand_id AND state = 1 limit 2,1;
			IF vn_rd_id1 IS NOT NULL THEN
				SELECT  id,state,percentage,refute_percentage,rule_percentage INTO vd_arb_id3,vd_arb_state3,vd_arb_percentage3,vd_arb_refute_percentage3,vd_arb_rule_percentage3 FROM arbitration WHERE receive_demand_id = vn_rd_id3 ;
			ELSE 
				SET vn_rd_length = vn_rd_length + 1;
			END IF;

			IF vn_rd_length >0 THEN
				SET vd_da_agv_amount = vd_da_amount/vn_rd_length;
				IF vd_rd_amount1 IS NOT NULL THEN  -- 做任务人1有报价
						IF vd_arb_id1 IS NOT NULL THEN  -- 含有仲裁 
							IF vd_arb_state1 = 1 THEN  -- 同意仲裁状态
								IF vd_arb_percentage1<100 AND vd_arb_percentage1>0 THEN
									SET vd_percentage1 = vd_arb_percentage1/100;
								ELSE
									SET vd_percentage1 = 1;
								END IF;
							ELSEIF vd_arb_state1 = 4 THEN -- 平台裁决状态
								IF vd_arb_rule_percentage1<100 AND vd_arb_rule_percentage1>0 THEN
									SET vd_percentage1 = vd_arb_rule_percentage1/100;
								ELSE
									SET vd_percentage1 = 1;
								END IF;
 							END IF;
							SET vd_pay_amount1 = (vd_da_agv_amount + vd_rd_amount1)*vd_percentage1;
							SET vd_arb_amount1 = (vd_da_agv_amount + vd_rd_amount1)*(1-vd_percentage1);
						-- ELSE  -- 不含有仲裁
						END IF;
				ELSE   -- 做任务人1没有报价
						IF vd_arb_id1 IS NOT NULL THEN  -- 含有仲裁 
							IF vd_arb_state1 =1 THEN  -- 同意仲裁状态
								IF vd_arb_percentage1<100 AND vd_arb_percentage1>0 THEN
									SET vd_percentage1 = vd_arb_percentage1/100;
								ELSE
									SET vd_percentage1 = 1;
								END IF;
							ELSEIF vd_arb_state1 = 4 THEN -- 平台裁决状态
								IF vd_arb_rule_percentage1<100 AND vd_arb_rule_percentage1>0 THEN
									SET vd_percentage1 = vd_arb_rule_percentage1/100;
								ELSE
									SET vd_percentage1 = 1;
								END IF;
 							END IF;
							SET vd_pay_amount1 = (vd_da_agv_amount + vd_amount/vn_rd_length)*vd_percentage1;
							SET vd_arb_amount1 = (vd_da_agv_amount + vd_amount/vn_rd_length)*(1-vd_percentage1);
						-- ELSE  -- 不含有仲裁
						END IF;
				END IF;

			IF vd_rd_amount2 IS NOT NULL THEN  -- 做任务人1有报价
						IF vd_arb_id2 IS NOT NULL THEN  -- 含有仲裁 
							IF vd_arb_state2 = 1 THEN  -- 同意仲裁状态
								IF vd_arb_percentage2<100 AND vd_arb_percentage2>0 THEN
									SET vd_percentage2 = vd_arb_percentage2/100;
								ELSE
									SET vd_percentage2 = 1;
								END IF;
							ELSEIF vd_arb_state2 = 4 THEN -- 平台裁决状态
								IF vd_arb_rule_percentage2<100 AND vd_arb_rule_percentage2>0 THEN
									SET vd_percentage2 = vd_arb_rule_percentage2/100;
								ELSE
									SET vd_percentage2 = 1;
								END IF;
 							END IF;
							SET vd_pay_amount2 = (vd_da_agv_amount + vd_rd_amount2)*vd_percentage2;
							SET vd_arb_amount2 = (vd_da_agv_amount + vd_rd_amount2)*(1-vd_percentage2);
						-- ELSE  -- 不含有仲裁
						END IF;
				ELSE   -- 做任务人1没有报价
						IF vd_arb_id2 IS NOT NULL THEN  -- 含有仲裁 
							IF vd_arb_state2 =1 THEN  -- 同意仲裁状态
								IF vd_arb_percentage2<100 AND vd_arb_percentage2>0 THEN
									SET vd_percentage2 = vd_arb_percentage2/100;
								ELSE
									SET vd_percentage2 = 1;
								END IF;
							ELSEIF vd_arb_state2 = 4 THEN -- 平台裁决状态
								IF vd_arb_rule_percentage2<100 AND vd_arb_rule_percentage2>0 THEN
									SET vd_percentage2 = vd_arb_rule_percentage2/100;
								ELSE
									SET vd_percentage2 = 1;
								END IF;
 							END IF;
							SET vd_pay_amount2 = (vd_da_agv_amount + vd_amount/vn_rd_length)*vd_percentage2;
							SET vd_arb_amount2 = (vd_da_agv_amount + vd_amount/vn_rd_length)*(1-vd_percentage2);
						-- ELSE  -- 不含有仲裁
						END IF;
				END IF;

			IF vd_rd_amount3 IS NOT NULL THEN  -- 做任务人1有报价
						IF vd_arb_id3 IS NOT NULL THEN  -- 含有仲裁 
							IF vd_arb_state3 = 1 THEN  -- 同意仲裁状态
								IF vd_arb_percentage3 < 100 AND vd_arb_percentage3 >0 THEN
									SET vd_percentage3 = vd_arb_percentage3/100;
								ELSE
									SET vd_percentage3 = 1;
								END IF;
							ELSEIF vd_arb_state3 = 4 THEN -- 平台裁决状态
								IF vd_arb_rule_percentage3 < 100 AND vd_arb_rule_percentage3>0 THEN
									SET vd_percentage3 = vd_arb_rule_percentage3/100;
								ELSE
									SET vd_percentage3 = 1;
								END IF;
 							END IF;
							SET vd_pay_amount3 = (vd_da_agv_amount + vd_rd_amount3)*vd_percentage3;
							SET vd_arb_amount3 = (vd_da_agv_amount + vd_rd_amount3)*(1-vd_percentage3);
						-- ELSE  -- 不含有仲裁
						END IF;
				ELSE   -- 做任务人1没有报价
						IF vd_arb_id3 IS NOT NULL THEN  -- 含有仲裁 
							IF vd_arb_state3 =1 THEN  -- 同意仲裁状态
								IF vd_arb_percentage3<100 AND vd_arb_percentage3>0 THEN
									SET vd_percentage3 = vd_arb_percentage3/100;
								ELSE
									SET vd_percentage3 = 1;
								END IF;
							ELSEIF vd_arb_state3 = 4 THEN -- 平台裁决状态
								IF vd_arb_rule_percentage3 <100 AND vd_arb_rule_percentage3 >0 THEN
									SET vd_percentage3 = vd_arb_rule_percentage3/100;
								ELSE
									SET vd_percentage3 = 1;
								END IF;
 							END IF;
							SET vd_pay_amount3 = (vd_da_agv_amount + vd_amount/vn_rd_length)*vd_percentage3;
							SET vd_arb_amount3 = (vd_da_agv_amount + vd_amount/vn_rd_length)*(1-vd_percentage3);
						-- ELSE  -- 不含有仲裁
						END IF;
				END IF;


			END IF;

		END IF;
		
	END IF;

	IF t_error = 1 THEN  
		ROLLBACK;  
	ELSE  
		COMMIT;  
	END IF; 
END
;;
DELIMITER ;
